import './App.css';
import logo from './Pictures/plogo.png';
import homeScreen from './Pictures/homeScreen.jpg'
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import specialEventParkingImage from "./specialEventParkingImage.jpg"
import golfCartServicesImage from "./specialEventParkingImage.jpg"
import bannerImage from "./Pictures/bannerImage."





export function ValetParking() {

    const Banner = () => {
        return (
          <div className="banner">
            <img src={bannerImage} alt="Valet Parking Services" className="banner-image" />
            <div className="banner-text">
              <h1>VALET PARKING SERVICES AND SHUTTLE SOLUTIONS</h1>
              <p>Let parking pros serve you today!</p>
            </div>
          </div>
        );
      };



  const Image = () => {
    return (
      <div className="main-container">
        <div className="image-container">
          <img src={homeScreen} alt="Commercial Services" />
          <div className="image-overlay">
            <h1>SERVICE IS THE KEY</h1>
            <h2>Let Us Park for You</h2>
            <button className="talk-to-us-btn">Talk to Us</button>
          </div>
        </div>
      </div>
    );
}


  const Footer = () => {
        return (
          <footer className="footer">
            <Container>
              <Row>
                <Col md={3} sm={6}>
                  <h5>Peninsula Parking</h5>
                  <p><i className="fas fa-phone"></i> 650-508-8886</p>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Services</h5>
                  <ul>
                    <li>Valet Parking</li>
                    <li>Commercial Services</li>
                    <li>Airport Valet Parking</li>
                    {/* Add more services as needed */}
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Company</h5>
                  <ul>
                    <li>Employment</li>
                    <li>Partners</li>
                    <li>About Us</li>
                    <li>Contact Us</li>

                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Locations</h5>
                  <ul>
                    <li>Menlo Park Valet Parking Services</li>
                    <li>Palo Alto Valet Parking Services</li>
                    {/* Add more locations as needed */}
                  </ul>
                </Col>
              </Row>
            </Container>
          </footer>
        );
      }


      const NavbarComponent = () => {
        return (
          <nav className="navbar">
            <Container>
              <div className="logo">
                <img style={{ width: '200px', height: '80%' }} src={logo} alt="Logo" />
              </div>
              <ul className="nav-links">
                <li><a href="/valet-parking">Valet Parking</a></li>
                <li><a href="/commercial-services">Commercial Services</a></li>
                <li><a href="/locations">Locations</a></li>
                <li><a href="/Careers">Careers</a></li>
                <li><a href="/about">About</a></li>
                <li><a href="/ContactPage">Contact</a></li>
              </ul>
              <button className="quote-btn" style={{ padding:'13px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black', textDecoration: 'none'  }}>Request a Quote</a> </button>
            </Container>
          </nav>
        );
      };



return (

    <div>

     {NavbarComponent()}
     <div >
     {Banner()}
       {Image()}
       <div>


       {Footer()}
         </div>
         </div>
         </div>



   );





}
export default ValetParking;
